// ==UserScript==
// @name        ChatGPT typing sounds
// @namespace   CGPTTyping
// @match       https://chatgpt.com/*
// @grant       none
// @version     1.1
// @author      Vermiliion
// @description Adds typing sounds to the ChatGPT website
// @license     MIT
// @downloadURL https://update.greasyfork.org/scripts/563825/ChatGPT%20typing%20sounds.user.js
// @updateURL https://update.greasyfork.org/scripts/563825/ChatGPT%20typing%20sounds.meta.js
// ==/UserScript==

(function(){
  const audioBase641 = ""
  const audioBase642 = ""
  const audioBase643 = ""
  const audioBase644 = ""
  const audioBase645 = ""
  const audioBase646 = ""
  let audioBase64s = [
    audioBase641,
    audioBase642,
    audioBase643,
    audioBase644,
    audioBase645,
    audioBase646
  ];

  let audios = []

  for(let i = 0; i < audioBase64s.length; i++){

    const binary = atob(audioBase64s[i]);

    const len = binary.length;
    const bytes = new Uint8Array(len);
    for (let ii = 0; ii < len; ii++) {
        bytes[ii] = binary.charCodeAt(ii);
    }

    const blob = new Blob([bytes], { type: "audio/wav" });

    audios.push(URL.createObjectURL(blob));
  }
  audioBase64s = []; // Clear data


  //Sound for when you send a message
  let sendSoundBase64 = ""
  let sendSound;
  {
    const binary = atob(sendSoundBase64);

    const len = binary.length;
    const bytes = new Uint8Array(len);
    for (let ii = 0; ii < len; ii++) {
        bytes[ii] = binary.charCodeAt(ii);
    }

    const blob = new Blob([bytes], { type: "audio/wav" });

    sendSound = URL.createObjectURL(blob);
  }
  sendSoundBase64 = "";

  let carriageReturnBase64 = ""
  let carriageReturn;
  {
    const binary = atob(carriageReturnBase64);

    const len = binary.length;
    const bytes = new Uint8Array(len);
    for (let ii = 0; ii < len; ii++) {
        bytes[ii] = binary.charCodeAt(ii);
    }

    const blob = new Blob([bytes], { type: "audio/wav" });

    carriageReturn = URL.createObjectURL(blob);
  }
  carriageReturnBase64 = "";

  let lastMessageCanidate = false;

  const callback = (mutationList, observer) => {
    for (const mutation of mutationList) {

      if (mutation.type === "childList") {
        let addedNodes = mutation.addedNodes;

        if (!addedNodes || addedNodes.length === 0) return;

        let gptTyped = false;
        let userTyped = false;
        let lastMessage = false;
        let lastMessageCanidateFound = false;

        console.log(addedNodes)



        for(const node of addedNodes){
          if(node.nodeType === Node.ELEMENT_NODE && node.matches(".justify-start")){
            lastMessage = true;
          }
          if(node.nodeType === Node.ELEMENT_NODE && node.matches("[data-state=closed]")){
            lastMessageCanidateFound = true;
            lastMessageCanidate = true;
          }
          if(node.nodeType === Node.ELEMENT_NODE && node.matches(".ProseMirror-trailingBreak")){
            userTyped = true;
          }
          if(node.nodeType === Node.ELEMENT_NODE && node.matches(".text-message[data-message-author-role=assistant] *")) {
            gptTyped = true;
          } else if (node.nodeType === Node.TEXT_NODE) {
            if (node.parentElement && node.parentElement.matches(".text-message[data-message-author-role=assistant] *")) {
              gptTyped = true;
            }
          }
        }
        console.log(lastMessage);
        console.log(lastMessageCanidate);


        let audio;

        if (lastMessage && lastMessageCanidate){
          audio = new Audio(carriageReturn);
        }else if(userTyped){
          audio = new Audio(sendSound);
        } else if(gptTyped){
          audio = new Audio(audios[Math.floor(Math.random() * audios.length)]);
        }


        audio.volume = 0.1


        audio.play().then(() => {
          //console.log("playing send noise");
        }).catch(error => {
          //console.error("error playing sound:", error);
        });

        if(!lastMessageCanidateFound){
          lastMessageCanidate = false;
        }
      }
    }
  };

  // Create an observer instance linked to the callback function
  const observer = new MutationObserver(callback);

  // Start observing the target node for configured mutations
  observer.observe(document.body, { attributes: true, childList: true, subtree: true });

})();